<template>
    <div>
        <canvas id="samples-1" width="1000" height="1000"></canvas>
    </div>
</template>

<script>
    export default {
        name: "Home",
        mounted() {
            const canvas1 = document.getElementById("samples-1");
            const ctx = canvas1.getContext("2d");

            /**
             * 1. 绘制矩形
             **/
            // 填充颜色（背景颜色）
            ctx.fillStyle = "rgb(200,0,0)";
            // 轮廓颜色
            ctx.strokeStyle = "blue";
            // 绘制一个120x50的矩形，从坐标(10,10)开始
            ctx.fillRect(10, 10, 120, 50);
            // 绘制一个100x50矩形边框，从坐标(10,70)开始
            ctx.strokeRect(10, 70, 100, 50);


            // 再绘制一个矩形
            ctx.fillStyle = "rgba(0, 0, 200, 0.5)";
            ctx.fillRect(30, 30, 55, 50);

            /**
             * 2. 绘制路径
             */
            ctx.lineWidth = 10;  // 路径宽度
            ctx.lineCap = "round"; // 路径末端样式（可选值：butt：线段末端以方形结束; round：线段末端以圆形结束;square：线段末端以方形结束，但是增加了一个宽度和线段相同，高度是线段厚度一半的矩形区域。）
            ctx.lineJoin = "round";  // 同一个 path 内，设定线条与线条间接合处的样式（可选值：round：通过填充一个额外的，圆心在相连部分末端的扇形，绘制拐角的形状。 圆角的半径是线段的宽度。bevel：在相连部分的末端填充一个额外的以三角形为底的区域，每个部分都有各自独立的矩形拐角。miter(默认)：通过延伸相连部分的外边缘，使其相交于一点，形成一个额外的菱形区域。）
            ctx.strokeStyle = "orange"; // 路径颜色
            ctx.beginPath(); // 新建一条路径
            ctx.moveTo(50, 50);  // 把画笔移动到坐标(50, 50)
            ctx.lineTo(200, 50);  // 绘制一条从当前位置(200, 50)到指定坐标(200, 50)的直线
            // ctx.closePath();  // 闭合路径。会拉一条从当前点到path起始点的直线。如果当前点与起始点重合，则什么都不做
            ctx.stroke(); //绘制路径


            // 绘制三角形
            ctx.beginPath();
            ctx.moveTo(0, 200);
            ctx.lineTo(100, 200);
            ctx.lineTo(100, 300);
            ctx.closePath();  // 闭合路径
            ctx.stroke();  // 绘制路径
            ctx.fill();  // 填充颜色

            // 绘制虚线
            ctx.setLineDash([20, 10]);  // [实线长度, 间隙长度]
            ctx.beginPath();
            ctx.moveTo(0, 350);
            ctx.lineTo(300, 350);
            ctx.stroke(); //绘制路径

            /**
             * 3. 绘制弧形
             */
            ctx.beginPath();
            // API：arc(x, y, r, startAngle, endAngle, anticlockwise): 以(x, y) 为圆心，以r 为半径，从 startAngle 弧度开始到endAngle弧度结束。anticlosewise 是布尔值，true 表示逆时针，false 表示顺时针(默认是顺时针)。
            ctx.arc(250, 250, 40, 0, Math.PI / 2, false);  // 以坐标(250, 250)为圆心，半径40，弧度90度（180/2）
            ctx.stroke();


            /**
             * 4. 绘制文本
             */
            const ctx2 = canvas1.getContext("2d");
            ctx2.font = "20px sans-serif"
            ctx2.fillText("天若有情", 0, 400); // 在坐标（0, 400）填充指定文本
            ctx2.strokeText("天若有情", 0, 450); // 在坐标（0,450）绘制文本边框


            /**
             * 绘制图片
             */
            const img = new Image();   // 创建一个<img>元素
            img.src = "data:image/png;base64,";

            ctx.drawImage(img, 0, 450, 200, 200); // 在坐标（0,450）绘制图片，大小限制为: 200x200

        }
    }
</script>

